import { memo } from 'react'
import './PlaceAnOrder.scss'

function PlaceAnOrder({ languageList }) {
    return (
        <>
            <div className='section-tour-detail'>
                <div className='d-flex'>
                    <div>
                        <div>{languageList.txtSightseeingDay}</div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default memo(PlaceAnOrder)
